	 (706,6717,N'Sundsvalls Kommun',N'http://sundsvall.se/vuxenutbildning',N'GRNORI21B',N'Orienteringskurs 10v Studieteknik och digitala verktyg',N'grundläggande vuxenutbildning',N'https://sundsvall.alvis.se/hittakurser/kurs/39294',100.0,N'<![CDATA[ <br />Kursen ger dig möjlighet att utveckla grundläggande förmågor i att lära och studera med hjälp av digitala verktyg, ger dig kunskap kring olika faktorer som kan påverka din inlärning samt träning i att navigera i en digital värld. Du får även lära dig att använda både datorn och mobilen till kommunikation, informationssök och digitala hjälpmedel för att hitta det sätt du lär dig bäst på.<br /><br />I våra orienteringskurser utvecklas entreprenöriellt lärande, såsom initiativförmåga, kreativitet, ansvar och nyfikenhet. Kurserna ska även utveckla din digitala kompetens och språkliga förmåga.<br /><br />Du har möjlighet att söka studiemedel för den här kursen.<br /><a href=http://www.csn.se/>Läs mer om studiemedel på&nbsp;www.csn.se</a>.<br />&nbsp;<br />Ditt antagningsbesked<br />Antagningsbesked skickas via e-post cirka två veckor före kursstart.&nbsp;<a href=https://sundsvall.alvis.se/>Se ditt antagningsbesked och följ din ansökan via Mina sidor</a>. ]]>','2023-10-16 00:00:00.0','2023-12-22 00:00:00.0',50.0,'2023-04-01 00:00:00.0000000','2023-09-17 00:00:00.0000000',N'Sundsvall',N'GRNORI21B',NULL),
	 (707,6718,N'Sundsvalls Kommun',N'http://sundsvall.se/vuxenutbildning',N'GRNORI21G',N'Orienteringskurs 10v Digital kompetens',N'grundläggande vuxenutbildning',N'https://sundsvall.alvis.se/hittakurser/kurs/49762',100.0,N'<![CDATA[ <p>Kursen är för dig som vill komma igång att använda digitala verktyg och lära dig navigera i olika digitala miljöer inför studier och arbete.<br /><br />Du får exempelvis lära dig att hantera text, olika dokument och mail. Använda olika appar, webbsidor och digitala tjänster. Informationssökning på webben och säkerhet på internet. Du får lära och utveckla dig inom digitala ord, begrepp och symboler.<br /><br />I våra orienteringskurser utvecklas entreprenöriellt lärande, såsom initiativförmåga, kreativitet, ansvar och nyfikenhet. Kurserna ska även utveckla din digitala kompetens och språkliga förmåga.<br /><br />Du har möjlighet att söka studiemedel för den här kursen.<br /><a href=http://www.csn.se/>Läs mer om studiemedel på&nbsp;www.csn.se</a>.</p>Ditt antagningsbesked<br />Antagningsbesked skickas via e-post cirka två veckor före kursstart.&nbsp;<a href=https://sundsvall.alvis.se/>Se ditt antagningsbesked och följ din ansökan via Mina sidor</a>. ]]>','2023-10-16 00:00:00.0','2023-12-22 00:00:00.0',50.0,'2023-04-01 00:00:00.0000000','2023-09-17 00:00:00.0000000',N'Sundsvall',N'GRNORI21G',NULL),
	 (708,6719,N'Sundsvalls Kommun',N'http://sundsvall.se/vuxenutbildning',N'GRNORI21H',N'Orienteringskurs 10v Att jobba i Sverige',N'grundläggande vuxenutbildning',N'https://sundsvall.alvis.se/hittakurser/kurs/51594',100.0,N'<![CDATA[ <p style=margin-left:0cm; margin-right:0cm>Denna kurs är för dig som vill veta mer om hur arbetslivet i Sverige fungerar. Du får lära dig om avtal och regler på arbetsmarknaden, nya ord som används på jobbet och viktiga sociala regler när olika kulturer jobbar tillsammans. I kursen tittar vi på olika sätt att söka arbete, vi skriver CV och personligt brev.<br /><br />Du får också information om olika yrken där det finns jobb, utbildningar för att nå dit och möjlighet att fundera över vad just DU är intresserad av.</p><p style=margin-left:0cm; margin-right:0cm>I våra orienteringskurser utvecklas entreprenöriellt lärande, såsom initiativförmåga, kreativitet, ansvar och nyfikenhet. Kurserna ska även utveckla din digitala kompetens och språkliga förmåga.</p>Du har möjlighet att söka studiemedel för den här kursen<br /><a href=http://www.csn.se/>Läs mer om studiemedel på&nbsp;www.csn.se</a>.<br /><br />Ditt antagningsbesked<br />Antagningsbesked skickas via e-post cirka två veckor före kursstart.&nbsp;<a href=https://sundsvall.alvis.se/>Se ditt antagningsbesked och följ din ansökan via Mina sidor</a>. ]]>','2023-10-16 00:00:00.0','2023-12-22 00:00:00.0',50.0,'2023-04-01 00:00:00.0000000','2023-09-17 00:00:00.0000000',N'Sundsvall',N'GRNORI21H',NULL),
