	 (840,6961,N'Kramfors kommun, Yrkeshögskolan Höga kusten',N'www.yhk.se',N'YH00659',N'Byggnadsvård - Interiör och Hantverk',N'yrkeshögskoleutbildning',N'https://www.yhk.se/',400.0,N'För en byggnadsvårdare är oftast inte den ena dagen lik den andra. Efter utbildning hos oss kan du jobba med t.ex. tillverkning av specialsnickerier så som kök, dörrar och fönster men även restaureringsarbeten av historiskt värdefulla snickerier i exempelvis kyrkor, kulturmiljöer och andra byggnadsminnen. Även projektering och planering av arbeten med objekt skyddade av kulturminneslagen ingår.För att trivas inom kulturmiljövården bör du tycka om att jobba med utmaningar, vara flexibel och hantera snabba ändringar som kan uppstå i ett projekt. Du kan jobba mot högt ställda krav samtidigt som du har en ödmjukhet inför objekten och har ett öga för detaljer och historiskt ursprung. Du tycker det är roligt med problemlösning, är kritiskt undersökande och nyfiken på att hela tiden lära dig mer.Utbildningen innehåller bland annat kurser inom fönsterhantverk, profilhyvling för hand, rittekniker, traditionellt måleri, företagande samt restaurering och tillverkning av äldre inredningssnickerier. Vi ger dig en bred bas och kunskap om kulturmiljövårdens hantverk, synsätt och värderingar. Du utvecklar din känsla för detaljer och med inspiration från hantverkare, antikvarier, konservatorer och arkitekter får du inblick i hantverk, materialkunskap och verktygsvård.En hantverkares kompetens inom kulturmiljövården är högt efterfrågad och jobben finns hos konsultföretag, entreprenörer, kommuner men även hos statliga organisationer som exempelvis länsmuseer och länsstyrelser. Skansen i Stockholm, Gunnebo Slott utanför Mölndal, Jamtli i Östersund, Skärgårdsstiftelsen och alla företag inom specialsnickerier så som Gamla stans kulturbygg, Kompetens i trä, Kulturarvet med flera är alla potentiella arbetsplatser.Det råder idag och under lång tid framöver brist på utbildade hantverkare med kunskap om både praktiskt hantverk och kulturmiljövårdens synsätt. Samhällets krav på hållbarhet och kvalitet ökar hela tiden vilket gör att branschens efterfrågan på utbildad kompetent personal också ökar.Utbildningen är upplagd så att du som studerande skall få så bra förutsättningar som möjligt i din kommande yrkesroll. En del av utbildningen sker därför ute på olika företag och arbetsplatser i kursen Lärande i arbete (LIA). Där får du praktisera och tillämpa dina kunskaper samt se och lära av verkligheten. Under LIA-perioden har man handledare vid sin sida som tar huvudansvaret, stöttar och leder arbetet.Genom ett stort och aktuellt kontaktnät i branschen, får du som studerar hos oss på Yrkeshögskolan Höga kusten i Kramfors, mycket goda förutsättningar att hitta en intressant, och lärorik praktikplats på ett företag. Hos oss får du de kunskaper och verktyg du behöver för att kunna arbeta som anställd eller egen företagare.Kommentarer från branschen:?Utan de historiska hantverken kan varken möbler eller byggnader bevaras till framtiden?.- Stefan Günther, Slottsarkitekt vid Gunnebo Slott och Trädgårdar AB.','2023-09-04 00:00:00.0','2025-06-06 00:00:00.0',100.0,NULL,NULL,N'Kramfors',N'525582d',NULL);
